export interface TreeNode<T = any> {
    id?: string;
    pid?: string;
    label?: string;
    data?: T;
    icon?: string;
    expandedIcon?: any;
    collapsedIcon?: any;
    children?: TreeNode<T>[];
    leaf?: boolean;
    expanded?: boolean;
    type?: string;
    parent?: TreeNode<T>;
    partialSelected?: boolean;
    styleClass?: string;
    draggable?: boolean;
    droppable?: boolean;
    selectable?: boolean;
    key?: string;
    frequency?: string;
    uom?: string;
    targetValue?: number;
    achivementValue?: number;
    quantify?: string;
    plant?: string;
    plantId?: string;
    strategicKpiId?: string;
    visionId?: string;
    uomId?: string;
    frequencyId?: string;
    kpiId?: string;
    kpiCode?: string;
    frequencyColor?: string;
    allowAutoTargetEntry?: string;
}